import React from "react";

import "./list.styles.scss";

const BirdsList = () => {
  return (
    <div className="bird-list-container">
      <ul className="bird-list">
        <li className="list">
          <input type="radio">Bird1</input>
        </li>

        <li className="list">Bird2</li>
        <li className="list">Bird3</li>
        <li className="list">Bird4</li>
        <li className="list">Bird5</li>
        <li className="list">Bird6</li>
      </ul>
    </div>
  );
};

export default BirdsList;
